import axios from 'axios'

function sendResult(){
    axios.post('http://127.0.0.1:5000/user',
    {
        'name' : 'test',
        'age' : 10
    })
}

function getIdNum(){
    print (axios.get('http://127.0.0.1:5000/getIdNum'))
    return 0
}
export {sendResult, getIdNum}
